import { Injectable, ViewChild } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class FoodListService {

  private list: Array<string> = [
    "X bacon",
    "Feijão",
    "Ovo"
  ];


  constructor() { }

  public foodList(){
    return this.list;
  }

  public foodListAdd(value:string){
    return this.list.push(value);
  }
}
